import React from 'react'
import { Link } from "react-router-dom";
import {toast} from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css'; 
import "./NavBar.css";

function NavBar() {

    return (
        <div>
            <nav className='navbar'>
                <ul className='list'>
                    <li>Home</li>
                    
                </ul>
            </nav>
        </div>
    )
}

export default NavBar
